export default {
  placeholder: {
    username: 'Nome Utente',
    password: 'Password',
    email: 'Email',
    firstName: 'Nome',
    lastName: 'Cognome',
  },
  errors: {
    username: {
      default: 'Inserisci il tuo nome utente',
      required: 'Il nome utente é obbligatorio',
    },
    password: {
      default: 'Inserisci la tua password',
      required: 'La password é obbligatoria',
    },
    email: {
      default: 'Inserisci la tua email',
      invalid: 'Inserisci una mail valida',
      required: 'La email é obbligatoria',
    },
    firstName: {
      default: 'Inserisci il tuo nome',
      required: 'Il nome é obbligatorio',
    },
    lastName: {
      default: 'Inserisci il cognome',
      required: 'Il cognome é obbligatorio',
    },
  },
  primary: 'Registrati',
  alreadyUser: 'Hai giá un account? Effettua il login',
};
